import logo from "../assets/search.gif";
import styles from "./NavBar.module.css"
import style from "../App.module.css";

interface Props {
	onSelectSearch: (search: search) => void;
}

function handleSearch(event) {
	onSelectSearch(event.target.value);
};
function NavBar( {onSelectSearch} : Props ) {
        return (
                <>
		<form className={style}>
		<div className={style.search}>
		<label htmlFor="search" className={style.searchword}></label>
		<input id="search" placeholder="search games" type="text" className={style.searchbar} />
		<button className={style.searchbutton} type="submit">
		<div>Search</div>
		<div><img className={styles.searchImage} src={logo} /></div>
		</button>
		</div>
		</form>
                </>
        );
}

export default NavBar;
